import React from 'react'
import { Title } from '../Styled'

function Artist(props) {

  return (
    <div>
      <div>
        <Title>Artist Name</Title>
        <Title>{JSON.stringify(props.artists[0])}</Title>
        {}
      </div>
    </div>
  );
}

export default Artist
